import * as React from 'react';
import Tabs from '@mui/material/Tabs';
import Tab from '@mui/material/Tab';
import Box from '@mui/material/Box';
import Typography from '@mui/material/Typography';

export default function IconPositionTabs() {
  const [value, setValue] = React.useState(0);

  const [zone, setZone] = React.useState("");
  const [cluster, setCluster] = React.useState("");
  const [envNumber, setEnvNumber] = React.useState("");

  const clusterOptions = {
    NCZ: ["DEV", "IN5", "RAT", "SYS"],
    DPZ: ["RAT", "EXT", "ORT"],
  };

  const handleZoneChange = (event) => {
    setZone(event.target.value);
    setCluster("");
  };

  const handleChange = (event: React.SyntheticEvent, newValue: number) => {
    setValue(newValue);
  };

  return (
    <Box>

      <Tabs
        value={value}
        onChange={handleChange}
        aria-label="icon position tabs example"
      >
        <Tab label="Requestor/Group Details" />
        <Tab label="Environment Variables" />
        <Tab label="Application Specs" />
        <Tab label="Kafka Topics" />
      </Tabs>


      <Box sx={{ p: 2 }}>
        {value === 0 && (
          <Typography variant="body1">Requestor/Group Details Content</Typography>
        )}
        {value === 1 && (
          <Typography variant="body1">Environment Variables Content</Typography>
        )}
        {value === 2 && (
          <Typography variant="body1">Application Specs Content</Typography>
        )}
        {value === 3 && (
          <Typography variant="body1">Kafka Topics Content</Typography>
        )}
      </Box>
    </Box>
  );
}
